import React from "react";
import {sensor_data} from "../fake_data/fake_data";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";

import TextField from '@material-ui/core/TextField';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';

import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';

import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import FormControl from '@material-ui/core/FormControl';


class AlertSummaryCard extends React.Component {
    render() {

        // Deconstruct props.
        const { alert_name, alert_id, cb_remove_alert } = this.props;

        return (
            <div style={{paddingTop: '20px', width: '100%'}}>
                <Card style={{width: '100%', backgroundColor: '#EEEEEE'}}>
                  <CardContent style={{display: 'flex', flexDirection: 'column', alignItems: 'flex-start'}}>
                    <Typography variant="h5" component="h2">
                        {alert_name}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button size="small" onClick={() => cb_remove_alert(alert_id)}>Delete</Button>
                  </CardActions>
                </Card>
            </div>
        )
    }
}

class CreateAlertDialog extends React.Component {

    constructor(props) {
        super();
        this.state = {
            open: false,
            name: "",
            sensor: props.sensors[0]
        };

        this.handleClickOpen = this.handleClickOpen.bind(this);
        this.handleClose = this.handleClose.bind(this);
        this.handleCreate = this.handleCreate.bind(this);
        this.handleNameChange = this.handleNameChange.bind(this);
        this.handleSensorChange = this.handleSensorChange.bind(this);
    }

    handleClickOpen()  {
        this.setState((state) => {
            return {open: true}
        })
    }

    handleNameChange = (event) => {
        this.setState({
            name: event.target.value,
        });
    };

    handleSensorChange = (event) => {

        // Find the sensor with the right id.
        const sensor = this.props.sensors.filter(sensor => sensor.id == event.target.value)[0];

        this.setState({
            sensor: sensor
        });
    };

    handleClose() {
        this.setState((state) => {
            return {open: false, name: ""}
        })
    }

    handleCreate() {
        if (this.state.name !== "") {
            this.setState((state) => {
                return {open: false, name: ""}
            });
            this.props.cb_add_alert(this.state.name);
        }
    }

    render() {
        return (
            <div>
                <Button variant="outlined" color="primary" onClick={this.handleClickOpen}>
                    Create New Alert
                </Button>
                <Dialog disableBackdropClick disableEscapeKeyDown open={this.state.open} onClose={this.handleClose}>
                    <DialogTitle>Create Alert</DialogTitle>
                    <DialogContent>
                        <form style={{display: 'flex', flexDirection: 'column'}}>
                            <FormControl style={{paddingBottom: '20px'}}>
                                <TextField
                                    id="alert-name"
                                    label="Alert Name"
                                    value={this.state.name}
                                    onChange={this.handleNameChange}
                                    variant="outlined"
                                />
                            </FormControl>
                            <FormControl style={{paddingBottom: '20px'}}>
                                <InputLabel htmlFor="demo-dialog-native">Sensor</InputLabel>
                                <Select
                                    native
                                    value={this.state.sensor}
                                    onChange={this.handleSensorChange}
                                    input={<Input id="demo-dialog-native" />}
                                >
                                    {this.props.sensors.map(sensor => (
                                        <option value={sensor.id}>{sensor.name}</option>
                                    ))}
                                </Select>
                            </FormControl>
                            <FormControl>
                                <DialogContentText id="alert-dialog-description">
                                    This sensor is of type: {this.state.sensor.type}
                                </DialogContentText>
                            </FormControl>
                        </form>
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={this.handleClose} color="primary">Cancel</Button>
                        <Button onClick={this.handleCreate} color="primary">Create</Button>
                    </DialogActions>
                </Dialog>
            </div>
        )
    }
}

export { AlertSummaryCard, CreateAlertDialog };
